import React from 'react';
import './fireworks.css';

const images = [
  'https://c4.wallpaperflare.com/wallpaper/990/547/605/digital-art-futuristic-city-car-artwork-wallpaper-preview.jpg/150',
  'https://c4.wallpaperflare.com/wallpaper/840/954/346/dark-night-rain-car-wallpaper-preview.jpg/150',
  'https://c4.wallpaperflare.com/wallpaper/663/420/862/car-purple-retrowave-landscape-wallpaper-preview.jpg/150',
  'https://c4.wallpaperflare.com/wallpaper/1022/53/128/ultra-wide-car-nissan-skyline-gt-r-wallpaper-preview.jpg/150',
  'https://c4.wallpaperflare.com/wallpaper/1017/357/190/3d-render-car-city-wallpaper-preview.jpg150',
  'https://c4.wallpaperflare.com/wallpaper/157/340/999/car-sports-car-supercar-lamborghini-aventador-wallpaper-preview.jpg/150',
  'https://c4.wallpaperflare.com/wallpaper/383/154/335/car-khyzyl-saleem-mazda-rx-7-simple-background-wallpaper-preview.jpg/150',
  'https://c4.wallpaperflare.com/wallpaper/956/868/1012/car-nissan-race-cars-road-wallpaper-preview.jpg/150',
  // Add more image URLs as needed
];

const ImageGrid = () => {
  return (
    <div className="image-grid">
      {images.map((url, index) => (
        <div className="image-container" key={index}>
          <img src={url} alt={`Image ${index + 1}`} />
        </div>
      ))}
    </div>
  );
};

export default ImageGrid;
